Já dentro da máquina, ao vasculhar os ficheiros, pode-se encontrar credenciais em /var/www/html/connection.php (remote) www-data@falafel:/var/www/html$ cat connection.php
<?php define('DB_SERVER', 'localhost:3306'); define('DB_USERNAME', 'moshe'); define('DB_PASSWORD', 'falafelIsReallyTasty'); define('DB_DATABASE', 'falafel'); $db = mysqli_connect(DB_SERVER,DB_USERNAME,DB_PASSWORD,DB_DATABASE); // Check connection if (mysqli_connect_errno()) { echo "Failed to connect to MySQL: " . mysqli_connect_error(); }
?> Estas credenciais server para fazer login ao MySQL, mas se reutilizar-mos as credenciais para fazer login por ssh, vemos que as credenciais são válidas!
